942	969	services	c19ec0b2-3f68-4ac0-8892-ca74d6ac0409	{"id":"c19ec0b2-3f68-4ac0-8892-ca74d6ac0409","date_created":"2026-01-16T11:36:03.870Z","date_updated":"2026-01-20T12:25:14.614Z","hero_title":"Электротехническое оборудование","hero_subtitle":"Пром комплект заказ (ПКЗ) занимается разработкой стандартов, обучением и поддержкой своих участников, а также популяризацией безопасных практик в этой области","hero_advant":[{"content":"100% соответствие характеристикам"},{"content":"От 1 ГВт до 100 000 ГВт"},{"content":"Помощь в продвижении продукции"},{"content":"Техническая поддержка 24/7"}],"hero_image":"945e858e-7c9f-431a-81c1-0e2b69dd879c","about_title":"Широкий выбор электротехнического оборудования","about_content":"<h2>Где используется</h2>\\n<p>Принципиальные схемы представляют собой графическое изображение всех компонентов и соединений системы, позволяя легко визуализировать ее структуру и функциональность.</p>\\n<p>Они помогают инженерам и проектировщикам полностью понять структуру и работу системы, быстро определять место возникновения проблемы, легко передавать информацию другим специалистам, таким как: монтажники, электрики или техническая поддержка</p>\\n<h2>Принципиальные особенности</h2>\\n<p>Компании &laquo;Пром Комплект Заказ&raquo; уже 21 год, а начинали мы свой путь с 2004 года как небольшое предприятие, специализирующееся на инженерных системах. За два десятилетия активной работы она выросла в одного из лидеров отрасли, завоевав доверие клиентов благодаря высокому качеству услуг и профессионализму своих сотрудников.</p>\\n<p>Вот несколько достижений, которыми мы гордимся:</p>\\n<ul>\\n<li>Получение сертификата качества ISO 9001;</li>\\n<li>Завоевание награды \\"Лучший поставщик года\\" в 2015, 2018,2019 годах;</li>\\n<li>Участие в крупных проектах инфраструктурного развития;</li>\\n<li>Развитие программы корпоративной социальной ответственности;</li>\\n<li>Открытие 3 филиалов в городах Казань, Сызрань, Тольятти.</li>\\n</ul>","banner_value":"5 000 000","banner_unit":"ГВт","banner_description":"(гигаватт)","banner_content":"Суммарная мощность нашего оборудования, которое мы поставили клиентам за 2025 год","banner_article":null,"gallery_title":"Виды оборудования","faq_tag":"Этапы работы","faq_title":"Что включает ПОСТАВКА электротехнического оборудования","faq_items":[{"title":"Подбор оборудования и техническое сопровождение проекта","content":"<ul>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n</ul>"},{"title":"Подбор оборудования и техническое сопровождение проекта","content":"<ul>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n<li>Lorem ipsum dolor sit amet consectetur adipisicing elit. Recusandae quibusdam harum ea facere! Dolores at perspiciatis suscipit consectetur aperiam dolore blanditiis nobis repellendus atque voluptatem!</li>\\n<li>Lore