1083	1110	about_page	aaa51033-4329-4529-ae76-2ee35a54be2a	{"id":"aaa51033-4329-4529-ae76-2ee35a54be2a","date_created":"2026-01-20T19:09:47.600Z","date_updated":"2026-01-20T19:11:06.099Z","hero_title":"Работаем над сложным, чтобы вам было легко","hero_subtitle":"Мы становимся частью вашей команды — помогаем решить сложные задачи, сократить сроки и реализовать проект без лишних рисков","hero_image":"945e858e-7c9f-431a-81c1-0e2b69dd879c","advant_title":"Профессиональная экспертиза","advant_subtitle":"Компания «3A» оказывает услуги по аудиту, комплектации и техническому сопровождению при проектировании инженерных систем","advant_cards":[{"title":"Опыт 25 лет","content":"Мы - непосредственный производитель. Детальный анализ дела, изучение документов и фактов, связанных с делом"},{"title":"Опыт 25 лет","content":"Мы - непосредственный производитель. Детальный анализ дела, изучение документов и фактов, связанных с делом"},{"title":"Опыт 25 лет","content":"Мы - непосредственный производитель. Детальный анализ дела, изучение документов и фактов, связанных с делом"}],"gallery_title":"5 заводов и 17 складов","gallery_subtitle":"Собственные заводы и склады обеспечивают лучшую логистику по принципу “Точно вовремя”","about_title":"Наши принципы","about_content":"<p>Комплектующие для систем водоснабжения включают в себя трубы, фитинги, насосы, фильтры, счетчики воды, водонагреватели и другие элементы, необходимые для обеспечения подачи чистой питьевой воды в дома и здания.</p>\\n<p>Отличия комплектующих для систем водоснабжения от комплектующих для систем водоотведения заключаются в их функциональности. Комплектующие для водоотведения предназначены для удаления использованной воды и сточных вод из дома или здания, в то время как комплектующие для водоснабжения обеспечивают подачу чистой воды.</p>\\n<p>Комплектующие для отопления отличаются от комплектующих для систем водоснабжения и водоотведения по принципу работы и назначению - обеспечение тепла в помещениях.</p>","gallery_slides":[1,2]}	{"about_title":"Наши принципы","about_content":"<p>Комплектующие для систем водоснабжения включают в себя трубы, фитинги, насосы, фильтры, счетчики воды, водонагреватели и другие элементы, необходимые для обеспечения подачи чистой питьевой воды в дома и здания.</p>\\n<p>Отличия комплектующих для систем водоснабжения от комплектующих для систем водоотведения заключаются в их функциональности. Комплектующие для водоотведения предназначены для удаления использованной воды и сточных вод из дома или здания, в то время как комплектующие для водоснабжения обеспечивают подачу чистой воды.</p>\\n<p>Комплектующие для отопления отличаются от комплектующих для систем водоснабжения и водоотведения по принципу работы и назначению - обеспечение тепла в помещениях.</p>","date_updated":"2026-01-20T19:11:06.099Z"}	\N	\N
